import React from "react";

export const ChartBar = (props) => {
  const value = (props.value / props.maxValue) * 100 + "%";
  const top = 100 - (props.value / props.maxValue) * 100 + "%";
  console.log(value);
  return (
    <>
      <div className="barMain">
        <div className="chart_outer">
          <div className="chartBar" style={{ height: value ,marginTop:top}}></div>
        </div>
        <p className="label">{props.label}</p>
      </div>
    </>
  );
};
